import './App.css';
import Navc from "./component/Navc";

import {
  BrowserRouter,
  Routes,
  Route
} from "react-router-dom";
import Home from './pages/Home';
import Login from './pages/Login';
import Productview from './pages/Productview';
import Cart from './pages/Cart';

function App() {
  return (
  <>

   <Navc/>
   <Routes>
      <Route path="/" element={<Home />} />
      <Route path="/home" element={<Home />} />
      <Route path="/login" element={<Login />} />
      <Route path="/cart" element={<Cart imgsc={"https://media.istockphoto.com/vectors/shopping-cart-icon-isolated-on-white-background-vector-id1206806317?s=612x612"} alt="Cart" />} />
      <Route path="/productview" element={<Productview />} />
    </Routes>

    </>
  )  
}

export default App;
